import React, { Component } from "react";
import axios from "axios";

class Active extends Component {
  confirm = () => {
    fetch("http://localhost:3001" + "/confirmation")
      .then(data => data.json())
      .then(res => this.setState({ data: res.data }));
  };
  render() {
    return;
  }
}

export default Active;
